class Solution {
    public List<String> separate_paren_groups(String paren_string) {
        List<String> result = new ArrayList<>();
        StringBuilder currentGroup = new StringBuilder();
        int balance = 0;

        for (char ch : paren_string.toCharArray()) {
            if (ch == ' ') {
                continue; // Ignore spaces
            }
            if (ch == '(') {
                if (balance == 0 && currentGroup.length() > 0) {
                    result.add(currentGroup.toString());
                    currentGroup.setLength(0); // Reset for the next group
                }
                currentGroup.append(ch);
                balance++;
            } else if (ch == ')') {
                currentGroup.append(ch);
                balance--;
            }

            // If balance is zero, we have a complete group
            if (balance == 0 && currentGroup.length() > 0) {
                result.add(currentGroup.toString());
                currentGroup.setLength(0); // Reset for the next group
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

