class Solution {
    public boolean isPalindrome(String string) {
        int i = 0;
        int j = string.length() - 1;
        while (i < j) {
            if (string.charAt(i) != string.charAt(j)) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }

    public String make_palindrome(String string) {
        int n = string.length();
        int i;
        for (i = n; i > 0; i--) {
            if (isPalindrome(string.substring(0, i))) {
                break;
            }
        }
        String suffix = string.substring(i);
        StringBuilder palindrome = new StringBuilder(string);
        palindrome.append(new StringBuilder(suffix).reverse());
        return palindrome.toString();
    }
}

