class Solution {
    public List<Double> rescale_to_unit(List<Double> numbers) {
        double min = Collections.min(numbers);
        double max = Collections.max(numbers);
        List<Double> rescaled = new ArrayList<>();

        for (double num : numbers) {
            double scaledValue = (num - min) / (max - min);
            rescaled.add(scaledValue);
        }

