class Solution {
    public List<Integer> sort_even(List<Integer> l) {
        List<Integer> result = new ArrayList<>(l);
        List<Integer> evenIndicesValues = new ArrayList<>();

        // Collect values at even indices
        for (int i = 0; i < l.size(); i += 2) {
            evenIndicesValues.add(l.get(i));
        }

        // Sort the collected even indices values
        Collections.sort(evenIndicesValues);

        // Place sorted values back into the result list at even indices
        for (int i = 0; i < evenIndicesValues.size(); i++) {
            result.set(i * 2, evenIndicesValues.get(i));
        }

        return result;
    }
}

