class Solution {
    public int largest_prime_factor(int n) {
        int largestPrime = -1;

        // Check for number of 2s that divide n
        while (n % 2 == 0) {
            largestPrime = 2;
            n /= 2;
        }

        // n must be odd at this point, so a skip of 2 (i.e., i = i + 2) can be used
        for (int i = 3; i <= Math.sqrt(n); i += 2) {
            // While i divides n, update n and largestPrime
            while (n % i == 0) {
                largestPrime = i;
                n /= i;
            }
        }

        // This condition is to check if n is a prime number greater than 2
        if (n > 2) {
            largestPrime = n;
        }

        return largestPrime;
    }
}

