class Solution {
    public int fruit_distribution(String s, int n) {
        String[] parts = s.split(" ");
        int apples = Integer.parseInt(parts[0]);
        int oranges = Integer.parseInt(parts[parts.length - 2]);
        return n - apples - oranges;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.fruit_distribution("5 apples and 6 oranges",19) == 8,
                s.fruit_distribution("5 apples and 6 oranges",21) == 10,
                s.fruit_distribution("0 apples and 1 oranges",3) == 2,
                s.fruit_distribution("1 apples and 0 oranges",3) == 2,
                s.fruit_distribution("2 apples and 3 oranges",100) == 95,
                s.fruit_distribution("2 apples and 3 oranges",5) == 0,
                s.fruit_distribution("1 apples and 100 oranges",120) == 19
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

