class Solution {
    public String circular_shift(int x, int shift) {
        String str = Integer.toString(x);
        int len = str.length();

        if (shift > len) {
            return new StringBuilder(str).reverse().toString();
        }

        shift = shift % len; // In case shift is greater than length
        String rightPart = str.substring(len - shift);
        String leftPart = str.substring(0, len - shift);

        return rightPart + leftPart;
    }
}

