class Solution {
    public boolean is_multiply_prime(int a) {
        List<Integer> primes = new ArrayList<>();
        for (int i = 2; i < 100; i++) {
            if (isPrime(i)) {
                primes.add(i);
            }
        }

        for (int i = 0; i < primes.size(); i++) {
            for (int j = i; j < primes.size(); j++) {
                for (int k = j; k < primes.size(); k++) {
                    if (primes.get(i) * primes.get(j) * primes.get(k) == a) {
                        return true;
                    }
                }
            }
        }
        return false;
    }

    private boolean isPrime(int num) {
        if (num <= 1) return false;
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) return false;
        }
        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_multiply_prime(5),
                s.is_multiply_prime(30),
                s.is_multiply_prime(8),
                !s.is_multiply_prime(10),
                s.is_multiply_prime(125),
                s.is_multiply_prime(3 * 5 * 7),
                !s.is_multiply_prime(3 * 6 * 7),
                !s.is_multiply_prime(9 * 9 * 9),
                !s.is_multiply_prime(11 * 9 * 9),
                s.is_multiply_prime(11 * 13 * 7)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

