class Solution {
    public String decimal_to_binary(int decimal) {
        StringBuilder binary = new StringBuilder();
        while (decimal > 0) {
            binary.append(decimal % 2);
            decimal /= 2;
        }
        binary.reverse(); // Reverse the string to get the correct binary representation
        return "db" + binary.toString() + "db";
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.decimal_to_binary(0), "db0db"),
                Objects.equals(s.decimal_to_binary(32), "db100000db"),
                Objects.equals(s.decimal_to_binary(103), "db1100111db"),
                Objects.equals(s.decimal_to_binary(15), "db1111db")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

