class Solution {
    public List<String> total_match(List<String> lst1, List<String> lst2) {
        int totalCharsLst1 = lst1.stream().mapToInt(String::length).sum();
        int totalCharsLst2 = lst2.stream().mapToInt(String::length).sum();

        if (totalCharsLst1 < totalCharsLst2) {
            return lst1;
        } else {
            return lst2;
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
