import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;
import java.lang.*;

class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 2; // 1 and 1
        }

        // Count of n-digit numbers that start with 1
        int startWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers that end with 1
        int endWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers that both start and end with 1
        int startAndEndWithOne = (int) Math.pow(10, n - 2);

        // Total count is the sum of both counts minus the overlap
        return startWithOne + endWithOne - startAndEndWithOne;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.starts_one_ends(1) == 1,
                s.starts_one_ends(2) == 18,
                s.starts_one_ends(3) == 180,
                s.starts_one_ends(4) == 1800,
                s.starts_one_ends(5) == 18000
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

