class Solution {
    public Optional<Integer> next_smallest(List<Integer> lst) {
        Set<Integer> uniqueElements = new HashSet<>(lst);
        if (uniqueElements.size() < 2) {
            return Optional.empty();
        }
        List<Integer> sortedList = new ArrayList<>(uniqueElements);
        Collections.sort(sortedList);
        return Optional.of(sortedList.get(1));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.next_smallest(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))).get() == 2,
                s.next_smallest(new ArrayList<>(Arrays.asList(5, 1, 4, 3, 2))).get() == 2,
                s.next_smallest(new ArrayList<>(List.of())).isEmpty(),
                s.next_smallest(new ArrayList<>(Arrays.asList(1, 1))).isEmpty(),
                s.next_smallest(new ArrayList<>(Arrays.asList(1, 1, 1, 1, 0))).get() == 1,
                s.next_smallest(new ArrayList<>(Arrays.asList(1, (int) Math.pow(0.0, 0.0)))).isEmpty(),
                s.next_smallest(new ArrayList<>(Arrays.asList(-35, 34, 12, -45))).get() == -35
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

