                s.skjkasdkd(Arrays.asList(0, 81, 12, 3, 1, 21)) == 3,
                s.skjkasdkd(Arrays.asList(0, 8, 1, 2, 1, 7)) == 7,
                s.skjkasdkd(List.of(8191)) == 19,
