class Solution {
    public List<Integer> make_a_pile(int n) {
        List<Integer> stones = new ArrayList<>();
        int currentStones = n;

        for (int i = 0; i < n; i++) {
            stones.add(currentStones);
            if (currentStones % 2 == 0) {
                currentStones += 2; // next even number
            } else {
                currentStones += 2; // next odd number
            }
        }

        return stones;
    }
}

