class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }

        int count = 0;
        int n = arr.size();

        for (int i = 0; i < n; i++) {
            if (arr.get(i) > arr.get((i + 1) % n)) {
                count++;
            }
        }

        return count <= 1;
    }
}

