class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        boolean hasOddInLst1 = false;
        boolean hasEvenInLst2 = false;

        for (int num : lst1) {
            if (num % 2 != 0) {
                hasOddInLst1 = true;
                break;
            }
        }

        for (int num : lst2) {
            if (num % 2 == 0) {
                hasEvenInLst2 = true;
                break;
            }
        }

        if (!hasOddInLst1) {
            return "YES"; // lst1 already contains only even numbers
        }

        return hasEvenInLst2 ? "YES" : "NO";
    }
}

