class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            if (sumOfDigits(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        boolean isNegative = num < 0;
        num = Math.abs(num);

        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }

        return isNegative ? -sum : sum;
    }
}

