class Solution {
    public int digits(int n) {
        int product = 1;
        boolean hasOdd = false;

        while (n > 0) {
            int digit = n % 10;
            if (digit % 2 != 0) { // Check if the digit is odd
                product *= digit;
                hasOdd = true;
            }
            n /= 10; // Remove the last digit
        }

        return hasOdd ? product : 0; // Return product if there's at least one odd digit, otherwise return 0
    }
}

