class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        List<Integer> result = new ArrayList<>();
        boolean[][] visited = new boolean[n][n];
        PriorityQueue<Path> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < k; i++) {
                if (a.values[i] != b.values[i]) {
                    return a.values[i] - b.values[i];
                }
            }
            return 0;
        });

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                pq.offer(new Path(new int[k], 0, i, j));
            }
        }

        while (!pq.isEmpty()) {
            Path current = pq.poll();
            if (current.length == k) {
                for (int i = 0; i < k; i++) {
                    result.add(current.values[i]);
                }
                return result;
            }

            if (current.x < 0 || current.x >= n || current.y < 0 || current.y >= n || visited[current.x][current.y]) {
                continue;
            }

            visited[current.x][current.y] = true;
            current.values[current.length] = grid.get(current.x).get(current.y);
            current.length++;

            for (int[] dir : new int[][]{{0, 1}, {1, 0}, {0, -1}, {-1, 0}}) {
                pq.offer(new Path(current.values.clone(), current.length, current.x + dir[0], current.y + dir[1]));
            }
        }

        return result;
    }

    private static class Path {
        int[] values;
        int length;
        int x, y;

        Path(int[] values, int length, int x, int y) {
            this.values = values;
            this.length = length;
            this.x = x;
            this.y = y;
        }
    }
}

