        int sum = 0;
        for (Double num : lst) {
            int rounded = (int) Math.ceil(num);
            sum += rounded * rounded;
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sum_squares(Arrays.asList(1., 2., 3.)) == 14,
                s.sum_squares(Arrays.asList(1.0, 2., 3.)) == 14,
                s.sum_squares(Arrays.asList(1., 3., 5., 7.)) == 84,
                s.sum_squares(Arrays.asList(1.4, 4.2, 0.)) == 29,
                s.sum_squares(Arrays.asList(-2.4, 1., 1.)) == 6,
                s.sum_squares(Arrays.asList(100., 1., 15., 2.)) == 10230,
                s.sum_squares(Arrays.asList(10000., 10000.)) == 200000000,
                s.sum_squares(Arrays.asList(-1.4, 4.6, 6.3)) == 75,
                s.sum_squares(Arrays.asList(-1.4, 17.9, 18.9, 19.9)) == 1086,
                s.sum_squares(List.of(0.)) == 0,
                s.sum_squares(List.of(-1.)) == 1,
                s.sum_squares(Arrays.asList(-1., 1., 0.)) == 2
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

