class Solution {
    public String file_name_check(String file_name) {
        // Check for the presence of exactly one dot
        int dotIndex = file_name.indexOf('.');
        if (dotIndex == -1 || file_name.indexOf('.', dotIndex + 1) != -1) {
            return "No";
        }

        // Split the file name into name and extension
        String namePart = file_name.substring(0, dotIndex);
        String extensionPart = file_name.substring(dotIndex + 1);

        // Check if the name part is not empty and starts with a letter
        if (namePart.isEmpty() || !Character.isLetter(namePart.charAt(0))) {
            return "No";
        }

        // Check for valid extensions
        List<String> validExtensions = Arrays.asList("txt", "exe", "dll");
        if (!validExtensions.contains(extensionPart)) {
            return "No";
        }

        // Count the number of digits in the name part
        int digitCount = 0;
        for (char c : namePart.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
            }
        }

        // Check if there are more than three digits
        if (digitCount > 3) {
            return "No";
        }

        return "Yes";
    }
}

