class Solution {
    public int get_max_triples(int n) {
        int[] a = new int[n];
        for (int i = 1; i <= n; i++) {
            a[i - 1] = i * i - i + 1;
        }

        int[] count = new int[3];
        for (int num : a) {
            count[num % 3]++;
        }

        int result = 0;
        // Calculate combinations of triples
        result += count[0] * (count[0] - 1) * (count[0] - 2) / 6; // All three are multiples of 3
        result += count[1] * count[1] * count[1] / 6; // All three are 1 mod 3
        result += count[2] * count[2] * count[2] / 6; // All three are 2 mod 3
        result += count[0] * count[1] * count[2]; // One from each category

        return result;
    }
}

