class Solution {
    public List<String> sorted_list_sum(List<String> lst) {
        List<String> result = new ArrayList<>();

        // Filter out strings with odd lengths
        for (String str : lst) {
            if (str.length() % 2 == 0) {
                result.add(str);
            }
        }

        // Sort the result first by length, then alphabetically
        Collections.sort(result, (a, b) -> {
            if (a.length() != b.length()) {
                return Integer.compare(a.length(), b.length());
            } else {
                return a.compareTo(b);
            }
        });

        return result;
    }
}

